import Image from '../components/image'

const About = () => {
    return (
        <div style={{fontSize: '20px', color: 'blue'}}>
            <h1>About</h1>
            <Link href="/">
                <button>Back</button>
            </Link>
            <p>I was a magician once</p>
        </div>
    )
}

export default About;
